  let [weaponImage, setWeaponImage] = useState(null);



  useEffect(() => {
    fetch("https://dogs.ceo/api/breeds/image/random", {mode: "cors"})
        .then(response => {
        const data = response.data;
        console.log(data.name);
      })
  }, [])



  return (
    <div>
      {weaponImage && <img src={weaponImage}></img>}
    </div>
  );
}

export default App;
